import React from 'react';
import './App.css';

function App() {
  return (
    <div className="portfolio-container">
      <header className="portfolio-header">
        <img src="/Rowan-Morrison-logo-02.png" alt="Rowan Morrison" className="logo" />
        <h1 className="name">Rowan Morrison</h1>
        <p className="tagline">Multidisciplinary Designer & Developer</p>

        <nav className="nav">
          <a href="#work">Work</a>
          <a href="#about">About</a>
          <a href="#contact">Contact</a>
        </nav>
      </header>
    </div>
  );
}

export default App;
